  false,\n\t\"url\": null,\n\t\"notes\": \"A survey of coral communities was carried
  out in the American Samoa Archipelago to assess the current status of coral reefs
  and provide a rigorous quantitative baseline dataset for future monitoring of these
  reefs. Five replicate belt transects were used to estimate the size structure, density
  and percent cover of corals at 29 locations around Tutuila and Manu'a Islands during
  October and November, 1995.\",\n\t\"license_title\": null,\n\t\"extras\": [{\n\t\t\"key\":
